const { Parallax, ParallaxLayer } = require('react-spring/addons.cjs')

export class App extends React.Component {

	constructor(props) {
		super(props);
	}
	render () {
		return (
			<Parallax pages={3} scrolling={true} horizontal ref={ref => (this.parallax = ref)}>
				{/* PAGE 1 */}
				<ParallaxLayer 
					offset={0}
					speed={0.5}
					style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}
					onClick={() => this.parallax.scrollTo(1)}>
						<img width="400em" src={'../static/placeholder.png'}/>
				</ParallaxLayer>
				<ParallaxLayer 
					offset={0.2}
					speed={.75}
					onClick={() => this.parallax.scrollTo(1)}
					style={{float: "center"}}>
				<img width="200" src={'../static/blob-shape (3).svg'}/>
				</ParallaxLayer> 
				<ParallaxLayer 
					offset={.6}
					speed={.75}
					style={{marginTop: '22em'}}
					onClick={() => this.parallax.scrollTo(1)}>
					<p> This is the first product. </p>
				</ParallaxLayer>
				{/* PAGE 2 */}
				<ParallaxLayer 
					offset={1}
					speed={0.5}
					style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}
					onClick={() => this.parallax.scrollTo(2)}>
						<img width="400em" src={'../static/placeholder.png'}/>
				</ParallaxLayer>

				{/* PAGE 3 */}
				<ParallaxLayer 
					offset={2}
					speed={0.5}
					style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
					<span onClick={() => this.parallax.scrollTo(0)}>
						<img width="400em" src={'../static/placeholder.png'}/>
					</span>
				</ParallaxLayer>
			</Parallax>

			)
}
}

export default App;
